INSERT INTO `exercise` (`id_exercise`, `muscle_type`, `name_exercise`, `picture_exercise`, `explication_exercise_1`, `explication_exercise_2`, `explication_exercise_3`, `explication_exercise_4`, `explication_exercise_5`, `explication_exercise_6`, `session_type`) VALUES
(11, 'Leg', 'Squat', , 'Stand with the bar on your upper-back, and your feet shoulder-width apart.\r\n', 'Squat down by pushing your knees to the side while moving hips back.', 'Break parallel by Squatting down until your hips are lower than your knees.', 'Squat back up while keeping your knees out and chest up.\r\n', 'Stand with your hips and knees locked at the top.\r\n', '', 1);
INSERT INTO `exercise` (`id_exercise`, `muscle_type`, `name_exercise`, `picture_exercise`, `explication_exercise_1`, `explication_exercise_2`, `explication_exercise_3`, `explication_exercise_4`, `explication_exercise_5`, `explication_exercise_6`, `session_type`) VALUES
(12, 'Leg', 'Leg press', , 'Choose the appropriate weight and set the seat so that the knees are bent just over right angles.', 'Position feet about shoulder width apart.', 'Try to push through your heels, keeping the knees lined up over the toes.', 'Extend the legs until nearly straight, avoiding locking the knees', 'Lower the weight slowly back towards the starting position.', 'Repeat for the number of reps required.', 1);
INSERT INTO `exercise` (`id_exercise`, `muscle_type`, `name_exercise`, `picture_exercise`, `explication_exercise_1`, `explication_exercise_2`, `explication_exercise_3`, `explication_exercise_4`, `explication_exercise_5`, `explication_exercise_6`, `session_type`) VALUES
(21, 'Chest', 'Bench press', , 'Lie on the bench with your eyes under the bar.\r\n', 'Grab the bar with a medium grip-width (thumbs around the bar!)\r\n', 'Unrack the bar by straightening your arms.', 'Lower the bar to your mid-chest.\r\n', 'Press the bar back up until your arms are straight.\r\n', '', 0);
INSERT INTO `exercise` (`id_exercise`, `muscle_type`, `name_exercise`, `picture_exercise`, `explication_exercise_1`, `explication_exercise_2`, `explication_exercise_3`, `explication_exercise_4`, `explication_exercise_5`, `explication_exercise_6`, `session_type`) VALUES
(22, 'Chest', 'Chest Fly', , 'Sit up tall. Relax your neck and shoulders. Your feet should be flat on the floor.', 'Grab the handles so that your palms are facing forward. Note that some machines have a foot bar that you need to push to bring the handles forward.', 'Press your arms together in front of your chest with a slow, controlled movement. Keep a slight, soft bend in the elbows with wrists relaxed.', 'Pause for one second once your arms are fully \"closed\" in front of your chest.', 'Bring your arms slowly back to the starting position, opening your chest and keeping posture strong and upright.', '', 0);
INSERT INTO `exercise` (`id_exercise`, `muscle_type`, `name_exercise`, `picture_exercise`, `explication_exercise_1`, `explication_exercise_2`, `explication_exercise_3`, `explication_exercise_4`, `explication_exercise_5`, `explication_exercise_6`, `session_type`) VALUES
(31, 'Biceps', 'Biceps curl', , 'Hold a dumbbell in each hand and stand with your feet as wide apart as your hips.', 'Let your arms hang down at your sides with your palms forward.', 'Pull your abdominals in, stand tall, and keep your knees slightly bent.', 'Curl both arms upward until they’re in front of your shoulders.', 'Slowly lower the dumbbells back down.', '', 2);
INSERT INTO `exercise` (`id_exercise`, `muscle_type`, `name_exercise`, `picture_exercise`, `explication_exercise_1`, `explication_exercise_2`, `explication_exercise_3`, `explication_exercise_4`, `explication_exercise_5`, `explication_exercise_6`, `session_type`) VALUES
(32, 'Biceps', 'Hammer curl', , 'Stand up with your torso upright and a dumbbell on each hand being held at arms length. The elbows should be close to the torso.\r\n', 'The palms of the hands should be facing your torso. This will be your starting position.', 'Now, while holding your upper arm stationary, exhale and curl the weight forward while contracting the biceps. Continue to raise the weight until the biceps are fully contracted and the dumbbell is at shoulder level. Hold the contracted position for a brief moment as you squeeze the biceps. Tip: Focus on keeping the elbow stationary and only moving your forearm.', 'After the brief pause, inhale and slowly begin the lower the dumbbells back down to the starting position', 'Repeat for the recommended amount of repetitions.\r\n', '', 2);
INSERT INTO `exercise` (`id_exercise`, `muscle_type`, `name_exercise`, `picture_exercise`, `explication_exercise_1`, `explication_exercise_2`, `explication_exercise_3`, `explication_exercise_4`, `explication_exercise_5`, `explication_exercise_6`, `session_type`) VALUES
(41, 'Triceps', 'Skullcrusher', , 'Lie down on your back. Your feet should be flat on the floor and your legs should be bent at the knees. If you\'re on a bench, your head should be at one end of the bench so you have space to use your weights.', 'Start with basic weights, such as dumbbells. If you haven\'t done this exercise before, start small. Hold the weights straight out from your chest. Your wrists should face inwards', 'Slowly bend your elbows, lowering the weights down towards your face. Keep your upper arms perpendicular to the floor, while your forearms move.', 'Slowly bring your arms back up to a straightened position. Repeat the movement.', '', '', 3);
INSERT INTO `exercise` (`id_exercise`, `muscle_type`, `name_exercise`, `picture_exercise`, `explication_exercise_1`, `explication_exercise_2`, `explication_exercise_3`, `explication_exercise_4`, `explication_exercise_5`, `explication_exercise_6`, `session_type`) VALUES
(42, 'Triceps', 'Cable triceps extension', , 'Attach a rope to the bottom pulley of the pulley machine.', 'Grasping the rope with both hands, extend your arms with your hands directly above your head using a neutral grip (palms facing each other). Your elbows should be in close to your head and the arms should be perpendicular to the floor with the knuckles ai', 'Slowly lower the rope behind your head as you hold the upper arms stationary. Inhale as you perform this movement and pause when your triceps are fully stretched.', 'Return to the starting position by flexing your triceps as you breathe out.', 'Repeat for the recommended amount of repetitions.', '', 3);
